public static AccessType toAccessType(QueueACL acl) {
  switch (acl) {
  case ADMINISTER_QUEUE:
    return AccessType.ADMINISTER_QUEUE;
  case SUBMIT_APPLICATIONS:
    return AccessType.SUBMIT_APP;
  }
  return null;
}
